/**
 * 
 * @param {number} castTimeCoefficient
 * @param {number} distribution
 * @param {number} coefficient
 * @param {number} diceCoefficient
 * @param {number} level
 * @returns {Array} [ value, dice ] or null
 */
function g_calculateScaling( castTimeCoefficient, distribution, coefficient, diceCoefficient, level) {
	var distIndex = ( distribution > 0 ? distribution - 1 : 11 ) * 100 + (level - 1);
	var value = 0, dice = 0;
	if( 
		coefficient != 0 &&
		distIndex < SPELL_SCALING.length 
	)
	{
		value = SPELL_SCALING[distIndex] * coefficient * castTimeCoefficient;
		dice = value * diceCoefficient;
		// change from average to min value
		value -= dice/2;
		return [value,dice];
	}
	
	return null;
}
/**
 * @param {number} castTimeStart
 * @param {number} castTimeEnd
 * @param {number} intervals
 * @param {number} level
 * @returns {Array} [ castTime, castTimeCoefficient ] or null
 */
function g_calculateCastTime( castTimeStart, castTimeEnd, intervals, level ) {
	if( 
		castTimeStart != castTimeEnd && 
		intervals > 0 && 
		castTimeEnd > 0 && 
		castTimeStart > 0 
	)
	{
		var castTime = Math.min( 
			castTimeEnd, 
			castTimeStart + ( castTimeEnd - castTimeStart ) / intervals * ( level - 1 )
		);

		return [castTime, castTime / castTimeEnd];
	}
	
	return null;
}
